import SearchBar from "./SearchBar";

const NavBar = () =>{
  function searchHandler(){
    window.alert("El ID que estoy buscando");
 }

  return(
    <div className="nav-bar">
      <div style='color=white'>Logo</div>
      <SearchBar onSearch={searchHandler}/>
    </div>
  );
}

export default NavBar;
